        <p> <b>Name:</b> {currentVan.name}</p>

       <p><b> Category:</b> {currentVan.type}</p>

       <p><b>Description: </b>{currentVan.description}</p>

       <p><b>Visibility:</b> Public</p>

</>
    )
}
